import React from 'react';

function CategoryDetail({ selectedCategory }) {
  if (!selectedCategory) return <div>Select a category to see details</div>;

  const { categoryName, postName, type } = selectedCategory;

  return (
    <div>
      <h2>Category: {categoryName}</h2>
      <h3>Post: {postName}</h3>
      <p>Type: {type}</p>
    </div>
  );
}

export default CategoryDetail;
